/*Table structure for table `customer_wallet_log` */

DROP TABLE IF EXISTS `customer_wallet_log`;

CREATE TABLE `customer_wallet_log` (
  `id` int(12) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `customer_id` varchar(30) NOT NULL DEFAULT '' COMMENT '用户ID',
  `customer_email` varchar(30) NOT NULL DEFAULT '' COMMENT '用户邮箱',
  `amount` decimal(10,4) NOT NULL DEFAULT '0.0000' COMMENT '变动金额',
  `wallet_balance` decimal(10,4) NOT NULL DEFAULT '0.0000' COMMENT '钱包余额',
  `type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '流水类型 1、raf未使用 2、分享获得 3、新用户注册 4、减扣 5、退回',
  `remark` varchar(254) NOT NULL DEFAULT '' COMMENT '备注',
  `create_at` datetime DEFAULT NULL COMMENT '使用时间',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `idx_customer_id` (`customer_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='用户钱包更改记录表';

