/*Table structure for table `help_config_data` */

DROP TABLE IF EXISTS `help_config_data`;

CREATE TABLE `help_config_data` (
  `config_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Config ID',
  `path` varchar(255) NOT NULL DEFAULT '' COMMENT 'Config Path',
  `path_name` varchar(255) DEFAULT '' COMMENT 'Config Path Name',
  `value` text COMMENT 'Config Value',
  `updated_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Updated At',
  `remark` varchar(255) NOT NULL DEFAULT '' COMMENT '输入框提示语',
  PRIMARY KEY (`config_id`) USING BTREE
