/*Table structure for table `tool_deduction_info` */

DROP TABLE IF EXISTS `tool_deduction_info`;

CREATE TABLE `tool_deduction_info` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID自增',
  `customer_email` varchar(100) NOT NULL DEFAULT '' COMMENT '客户邮箱',
  `state` varchar(100) NOT NULL DEFAULT '',
  `status` varchar(50) NOT NULL,
  `increment_id` varchar(50) NOT NULL DEFAULT '' COMMENT '订单号',
  `discount_description` text COMMENT '抵扣描述信息',
  `created_at` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `discount_total` float(6,2) NOT NULL DEFAULT '0.00' COMMENT '抵扣金额',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `idx_increment_id` (`increment_id`) USING BTREE,
  KEY `idx_email` (`customer_email`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='黑客增长--用户抵扣信息记录';

